import React from "react";
import ReactDOM  from "react-dom";
import "./index.css";
const csstyle = {}
var time = new Date(2023 , 5 ,5 ,2).getHours()
var greet = ''
if(time > 7 && time < 11){
  greet = "Good Morning"; 
  csstyle.color = "green";
}else if (time =>11 && time < 19) {
  greet = "Good Afternoon";
  csstyle.color = "orange";
} else {
  greet = "Good night";
  csstyle.color = "black";
};

ReactDOM.render(
  <>
    <h1>Hello Sir, <span style={csstyle}>{greet}</span></h1>
    <h2>{time}</h2>
  </>,
  document.getElementById("root")
)
